def transformDataSequenceToSAXSource(dataProvider: StreamSource, interchange: Interchange): SAXSource = {
    val inDataProvider: InputSource = if (dataProvider.getReader != null) {
        new InputSource(dataProvider.getReader)
    } else {
        new InputSource(dataProvider.getInputStream)
    }
    inDataProvider.setSystemId(dataProvider.getSystemId)
    inDataProvider.setPublicId(dataProvider.getPublicId)
    var subscriber: XMLReader = null
    var sproducer: SAXParserFactory = null
    try {
        if (interchange != null) {
            sproducer = interchange.acquireAttribute(Interchange.SAXPARSER_FACTORY, classOf[SAXParserFactory])
